DELIMITER @@ 
DROP PROCEDURE IF EXISTS sp_horarios_disponibles @@
CREATE PROCEDURE sp_horarios_disponibles
(
_turno int ,
_medico int ,
_fecha date
)
BEGIN
   IF (current_date() = _fecha) THEN
		 SELECT *
         FROM HORA 
         where id_turno = _turno AND Hora_Inicio>=curTime() 
		       AND id_hora NOT IN (SELECT ID_HORA
                                   FROM CITA
                                   WHERE ID_NUTRICIONISTA = _medico);
   ELSE IF(current_date()<_fecha) THEN
     
	     SELECT *
         FROM HORA 
         where id_turno = _turno 
		       AND id_hora NOT IN (SELECT ID_HORA
                                   FROM CITA
                                   WHERE ID_NUTRICIONISTA = _medico AND FECHA_CITA = _fecha);
     END IF;
   END IF;
END @@
DELIMITER ;



DELIMITER @@ 
DROP PROCEDURE IF EXISTS SP_CODIGO_NUTRICIONISTA @@
CREATE PROCEDURE SP_CODIGO_NUTRICIONISTA()
BEGIN
   DECLARE CUENTA INT;
   SELECT IFNULL(MAX(id_Nutricionista),0) + 1 INTO CUENTA FROM Nutricionista;
   
   SELECT CONCAT('u' , YEAR(NOW()),'N', CUENTA);
END @@
DELIMITER ;

DELIMITER @@ 
DROP PROCEDURE IF EXISTS SP_CODIGO_ADMIN @@
CREATE PROCEDURE SP_CODIGO_ADMIN()
BEGIN
   DECLARE CUENTA INT;
   SELECT IFNULL(MAX(id_Admi),0) + 1 INTO CUENTA FROM Administrador;
   
   SELECT CONCAT('a' , YEAR(NOW()),'N', CUENTA);
END @@
DELIMITER ;


DELIMITER @@ 
DROP PROCEDURE IF EXISTS sp_filtro_medicos_por_horario @@
CREATE PROCEDURE sp_filtro_medicos_por_horario(_TURNO INT )
BEGIN
  SELECT *
  FROM Nutricionista N
  WHERE Id_Nutricionista NOT IN (SELECT ID_NUTRICIONISTA
                                 FROM Horario_Nutricionista 
	    						 WHERE ID_TURNO = _TURNO)
 AND EXISTS (SELECT * FROM USUARIO U 
              WHERE N.Id_Usuario = U.Id_Usuario AND ESTADO = 1);
END @@
DELIMITER ;


